Over the past year, King Arthur Baking has been truly honored to partner with several extraordinary organizations and individuals working to create more equitable food systems across the country. Systems in which all Black, Indigenous, and People of Color (BIPOC) have the opportunity to grow, sell, buy, and eat healthy and culturally appropriate food. This work was the focus of our Diversity, Equity, and Inclusion fund established in June 2020, and going forward, will be a foundation of King Arthur’s giving program. Food justice is integral to realizing an inclusive, equitable future for all people, and we want to support the organizations building this movement. Learn more about Diversity, Equity, and Inclusion at King Arthur and view the fund recipients at the link in our profile >> @kingarthurbaking

